// 변수 초기화
val tables = spark.catalog.listTables().collect().map(table => table.name)
var tableName = tables(0)
var table = spark.table(tableName)
var numRows = table.count()

var numericalColumns = table.dtypes.filter(_._2 != "StringType").map(_._1)
var categoricalColumns = table.dtypes.filter(_._2 == "StringType").map(_._1)
